import React from 'react'
import ReactDom from 'react-dom'

// CSS
import './index.css'

// Setup vars
const books = [
  {
    img: 'https://images-na.ssl-images-amazon.com/images/I/81kv0vHJ0QL._AC_UL240_SR240,240_.jpg',
    title: 'I love TensorFlow Book',
    author: 'John Reed'
  },
  {
    img: 'https://images-na.ssl-images-amazon.com/images/I/71tQ6jq5-ZL._AC_UL210_SR210,210_.jpg',
    title: 'Start With Why',
    author: 'Simon Sinek'
  }
]



function BookList() {
  return (
    <section className='booklist'>
      {books.map((book) => {
        const {img,title,author} = book
        return (
          <Book book={book} />
        )
      })}
    </section>
  )
}

const Book = (props) => {

  console.log(props)

// destruct props object
  const {img, title, author} = props.book

  return (
    <article className='book'>
      <img src={img} alt=''/>
      <h1>{title}</h1>
      <h4>{author}</h4>
    </article>
  )
}

ReactDom.render(<BookList />, document.getElementById('root'))
